import React from "react";
import LineChart from '../src/Components/LineChart';
import DonutChart from '../src/Components/DonutChart'
import data from "./Data"; // JSON array export
import {
  Chart as ChartJS,
  LineElement,
  ArcElement,
  CategoryScale,
  LinearScale,
  PointElement,
  Tooltip,
  Legend
} from 'chart.js';

import './App.css';

ChartJS.register(
  LineElement,
  ArcElement,
  CategoryScale,
  LinearScale,
  PointElement,
  Tooltip,
  Legend
);

function App() {
  return (
    <div className="dashboard">
      <h1>Food Prices Dashboard</h1>
      <div className="charts-row">
        <LineChart data={data} />
        <DonutChart data={data} />
      </div>
    </div>
  );
}

export default App;
